import React from "react";
import "./style.css";
import EmployeeRow from "../EmployeeRow";

function SearchResults() {
  return (
    <table className = "employee-table">
        <thead>
  <tr>
    <th>Image</th>
    <th>Name</th>
    <th>Phone</th>
    <th>Email</th>
    <th>DOB</th>
  </tr>
  </thead>
  <EmployeeRow 
  name = "1"
  image = "2"
  phone ="3"
  email ="4"
  dob ="5"

  />
</table>
  );
}

export default SearchResults;
